package vexriscv.demo


import spinal.core._
import spinal.lib._
import spinal.lib.bus.amba3.apb._
import spinal.lib.bus.amba4.axi._

import spinal.lib.misc.HexTools

import scala.collection.mutable.ArrayBuffer
import scala.collection.Seq

class TinyClunx(
                onChipRamSize : BigInt
                ) extends Component{

    val axiConfig = Axi4Config(
    addressWidth = 17,
    dataWidth    = 64,
    idWidth      = 3,
    useRegion    = false,
    useLock      = false,
    useQos      = false,
    useResp = false,
    useProt=false,
    useStrb=false
        )

  val debug = true

  val io = new Bundle{
    //Clocks / reset
    val axiReset = in Bool()
    val axiClk   = in Bool()
    val axiM1    = slave(Axi4(axiConfig))
    val axiM2    = slave(Axi4(axiConfig))
    //val axiM1    = slave(Axi4Shared(axiConfig))
    //val axiM2    = slave(Axi4Shared(axiConfig))
  }

  val axiClockDomain = ClockDomain(
    clock = io.axiClk,
    reset = io.axiReset
    )

  val axi1 = new ClockingArea(axiClockDomain) {
    val ram1 = Axi4SharedOnChipRam(
      dataWidth = 64,
      byteCount = onChipRamSize,
      idWidth = axiConfig.idWidth+1
    )

    val ram2 = Axi4SharedOnChipRam(
      dataWidth = 64,
      byteCount = onChipRamSize,
      idWidth = axiConfig.idWidth+1
    )

    val axiCrossbar = Axi4CrossbarFactory()

    axiCrossbar.addSlaves(
      ram1.io.axi       -> (0x00000000L,   onChipRamSize),
      ram2.io.axi       -> (0x00010000L,   onChipRamSize)
    )

    axiCrossbar.addConnections(
      io.axiM2        -> List(ram1.io.axi, ram2.io.axi),
      io.axiM1        -> List(ram1.io.axi, ram2.io.axi)
    )


    axiCrossbar.build()

  }

}

object TinyClunx{
  def main(args: Array[String]) {
    val config = SpinalConfig()
    config.generateVerilog({
      val toplevel = new TinyClunx(onChipRamSize = 8 kB)
      toplevel
    })
  }
}

// With memory init
object TinyCClunxWithMemoryInit{
  def main(args: Array[String]) {
    val config = SpinalConfig()
    config.generateVerilog({
      val toplevel = new TinyClunx(onChipRamSize = 8 kB)
      HexTools.initRam(toplevel.axi1.ram1.ram, "src/main/ressource/hex/muraxDemo.hex", 0x80000000l)
      toplevel
    })
  }
}

#include <bits/stdc++.h>
using namespace std;

#define ll long long
#define mod 1000000007

int numLength(int n) {
    int res = 0;
    while(n) {
        res++;
        n/=10;
    }

    return res;
}

int solve(
    int n,
    vector<int> &candles
) {
    unordered_map<int, vector<pair<int, int>>> pairs;
    priority_queue<
        tuple<int, int, int>,
        vector<tuple<int, int, int>>,
        greater<tuple<int, int, int>>
    > pq;

    for(int i=0; i<=9; i++)
        pairs[i] = {};

    for(int i=0; i<candles.size(); i++) {
        for(int j=0; j<candles.size(); j++) {
            if(i == j)
                continue;
            
            if(i > j) {
                int diff = candles[i] - candles[j];
                pairs[diff].push_back({ candles[i], candles[j] });
                pq.push({ diff, candles[i], candles[j] });
            } else {
                int diff = candles[j] - candles[i];
                pairs[diff].push_back({ candles[j], candles[i] });
                pq.push({ diff, candles[j], candles[i] });
            }
        }
    }

    int res = INT_MAX;
    while(pq.size()) {
        auto t = pq.top();
        pq.pop();

        int n1 = get<1>(t);
        int n2 = get<2>(t);

        if(n1 == 0 || n2 == 0)
            continue;

        unordered_map<int, bool> taken;
        taken[n1] = true;
        taken[n2] = true;

        int curr_diff = 9;
        int ind = 0;
        sort(pairs[curr_diff].rbegin(), pairs[curr_diff].rend());

        while(numLength(n1) < n/2) {
            if(ind == pairs[curr_diff].size()) {
                curr_diff--;
                ind = 0;
                if(pairs[curr_diff].size() == 0)
                    continue;

                sort(pairs[curr_diff].rbegin(), pairs[curr_diff].rend());
            }

            int nextDigit1 = pairs[curr_diff][ind].second;
            int nextDigit2 = pairs[curr_diff][ind].first;
            ind++;

            if(taken[nextDigit1] || taken[nextDigit2])
                continue;

            n1 = n1*10 + nextDigit1;
            n2 = n2*10 + nextDigit2;
            taken[nextDigit1] = true;
            taken[nextDigit2] = true;
        }

        res = min(res, n1 - n2);
    }

    return res;
}

int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(0);
    ll test=1;
    cin>>test;

    while(test--) {	
        int n;
        cin>>n;
        vector<int> candles;

        for(int i=0; i<n; i++) {
            int ci;
            cin>>ci;
            candles.push_back(ci);
        }

        cout << solve(n, candles) << endl;
    }

    return 0;
}

