from time import sleep
from pyautogui import press

class KeyPresser:
    def __init__(self, key='j', interval=1):
        self.key = key
        self.interval = interval

    def press_key(self):
        press(self.key)

    def run(self):
        while True:
            self.press_key()
            sleep(self.interval)

if __name__ == "__main__":
    key_presser = KeyPresser()
    key_presser.run()

#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>
 
int **map;
 
void printmap(int l){
    for (int i=l-1; i>=0; i--){
        for (int j=0; j<l; j++) printf("%d ", map[i][j]);
        printf("\n");
    }
}
 
void report(int type, int x, int y){
    printf("%d %d %d\n", type, y, x);
    // int dy[5]={0, 1, -1, -1, 1};
    // int dx[5]={0, 1, 1, -1, -1};
    // map[x-1][y-1] = 1;
    // map[x+dx[type]-1][y-1]=1;
    // map[x-1][y+dy[type]-1]=1;
}
 
void solve(int row, int col, int x, int y, int l){
    int midrow=row+l/2, midcol=col+l/2;
    int type=0;
    if (l==1) return;
    if (x>=midrow && y>=midcol) type=1;
    else if (x>=midrow && y<midcol) type=2;
    else if (x<midrow && y<midcol) type=3;
    else if (x<midrow && y>=midcol) type=4;
    if (l==2){
        report(type, midrow, midcol);
        return;
    }
    if (type==1){ //I
        report(type, midrow, midcol);
        solve(row+l/2, col+l/2, x, y, l/2);
        solve(row, col, row+l/2-1, col+l/2-1, l/2);
        solve(row+l/2, col, row+l/2, col+l/2-1, l/2);
        solve(row, col+l/2, row+l/2-1, col+l/2, l/2);
    }
    else if (type==2){ //II
        report(type, midrow, midcol);
        solve(row+l/2, col+l/2, row+l/2, col+l/2, l/2);
        solve(row, col, row+l/2-1, col+l/2-1, l/2);
        solve(row+l/2, col, x, y, l/2);
        solve(row, col+l/2, row+l/2-1, col+l/2, l/2);
    }
    else if (type==3){ //III
        report(type, midrow, midcol);
        solve(row+l/2, col+l/2, row+l/2, col+l/2, l/2);
        solve(row, col, x, y, l/2);
        solve(row+l/2, col, row+l/2, col+l/2-1, l/2);
        solve(row, col+l/2, row+l/2-1, col+l/2, l/2);
    }
    else if (type=4){ //IV
        report(type, midrow, midcol);
        solve(row+l/2, col+l/2, row+l/2, col+l/2, l/2);
        solve(row, col, row+l/2-1, col+l/2-1, l/2);
        solve(row+l/2, col, row+l/2, col+l/2-1, l/2);
        solve(row, col+l/2, x, y, l/2);
    }
}
 
void lshape(int row, int col, int l){
    report(1, row+l/2, col+l/2);
    solve(row, col, row+l/2-1, col+l/2-1, l/2);
    solve(row+l/2, col, row+l/2, col+l/2-1, l/2);
    solve(row, col+l/2, row+l/2-1, col+l/2, l/2);
}
 
int main(){
    int l, m; scanf("%d%d", &l, &m);
    map = (int**)malloc(sizeof(int*)*l);
    for (int i=0; i<l; i++){
        map[i] = (int*)malloc(sizeof(int)*l);
        for (int j=0; j<l; j++) map[i][j]=0;
    }
    int rl=0;
    while (l!=m){
        lshape(rl, rl, l);
        l/=2;
        rl+=l;
    }
}

#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>
#define new(type) (type*)malloc(sizeof(type))
typedef unsigned long long ull;
 
void recursion(ull sum, ull array[], ull subsum[], int i, int n, int k, ull *finalans){
    if (i==n) *finalans = (sum<*finalans)?sum:*finalans;
    bool status=true;
    for (int t=0; t<k; t++){
        ull temp = sum+2*subsum[t]*array[i]+array[i]*array[i];
        if (temp>*finalans) continue;
        if (!status) break;
        if (subsum[t]==0) status=false;
        subsum[t]+=array[i];
        recursion(temp, array, subsum, i+1, n, k, finalans);
        subsum[t]-=array[i];
    }
}
 
int comp(const void *data1, const void *data2){
    ull *d1 = (ull*)data1;
    ull *d2 = (ull*)data2;
    if (*d1>*d2) return 1;
    else if (*d1<*d2) return -1;
    else return 0;
}
 
int main(){
    int n, k; scanf("%d%d", &n, &k);
    ull array[n], ans=0-1;
    ull subsum[k]; memset(subsum, 0, sizeof(subsum));
    for (int i=0; i<n; i++) scanf("%llu", &array[i]);
    qsort(array, n, sizeof(ull), comp);
    recursion(0, array, subsum, 0, n, k, &ans);
    printf("%llu\n", ans);
}

#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>
 
void swap(int array[], int a, int b){
    int temp=array[a];
    array[a]=array[b];
    array[b]=temp;
}
 
void print(int array[], int n){
    for (int i=0; i<n; i++) printf("%d ", array[i]);
    printf("\n");
}
 
void sort(int array[], int n){
    for (int i=n-1; i>0; i--) for (int j=0; j<i; j++){
        if (array[j]>array[j+1]) swap(array, j, j+1);
    }
}
 
void solve(int array[], bool enable[], int temp[], int n, int i){
    for (int t=0; t<n; t++){
        if (!enable[t]) continue;
        temp[i] = array[t];
        if (i==n-1){
            print(temp, n);
            break;
        }
        enable[t] = false;
        solve(array, enable, temp, n, i+1);
        enable[t] = true;
    }
}
 
int main(){
    int n; scanf("%d", &n);
    int array[n]; for (int i=0; i<n; i++) scanf("%d", &array[i]);
    bool enable[n]; memset(enable, true, sizeof(enable));
    int temp[n]; memset(temp, 0, sizeof(temp));
    sort(array, n);
    solve(array, enable, temp, n, 0);
}

from os.path import exists
from PIL import Image
import numpy as np
import zlib
import cv2
import time


sizes = [(256*144)*3, (640*480)*3, (1280*720)*3, (1920*1080)*3, (2560*1440)*3, (3840*2160)*3]
sizes_size = {
    0: {"name": "144p", "dimensions": (256, 144)},
    1: {"name": "480p", "dimensions": (640, 480)},
    2: {"name": "720p", "dimensions": (1280, 720)},
    3: {"name": "1080p", "dimensions": (1920, 1080)},
    4: {"name": "1440p", "dimensions": (2560, 1440)},
    5: {"name": "4k", "dimensions": (3840, 2160)}
}


def bits(stuff):
    if type(stuff) is bytes or type(stuff) is str:
        stuff = ord(stuff)
    out = []
    for bit in range(8):
        bit += 1
        out.append((stuff >> bit) & 1)
    return out


def getsize(size, mult):
    a, b = 0, 0

    while True:  # should always return something mostly square
        if a > b:
            b += 1
        elif b > a:
            a += 1
        else:
            a += 1
        if a*b*mult >= size:
            return [a, b]

# TODO:
#   (?) do multiple video formats/encodings
#   (?) threading/running on gpu


print("File to video\n")
df = input("Raw data or file? (d/f): ")
df = df.lower().strip()

while df not in ['f', "file", 'd', "data"]:
    print("Unknown option\n\n")
    print(df)
    df = input("Raw data or file? (d/f): ").lower().strip()

if df == 'f' or df == "file":
    file = input("file path: ")
    while not exists(file):
        file = input("unknown option\n\nfile path: ")

    print("loading file...")
    with open(file, "rb") as f:
        data = f.read()
elif df == 'd' or df == "data":
    data = input("data: ").encode()

# make sure if we don't already have data to make some
if len(data) == 0:
    data = b"\x00"

do_comp = input("compress image? (y/n): ").lower().strip()
while do_comp not in ['y', "yes", 'n', "no"]:
    print("Unknown option\n\n")
    do_comp = input("compress image? (y/n): ").lower().strip()

if do_comp == "n" or do_comp == "no":
    comp = 0
else:
    comp = input("compression level (0-9): ")
    while not comp.isdigit() and comp not in list(range(0, 10)):
        comp = input("Unknown option\ncompression level (0-9): ")


if comp != 0:
    print("compressing data...")
    data = zlib.compress(data, comp.isdigit())

max_size = -1

if len(data) < sizes[0]:
    max_size = 0
    print("data is smaller then lowest image size, outputting image")
    imgsize = getsize(len(data), 3)
    imgsize.append(3)
    image = np.zeros(imgsize)
    n = 0

    print("writing to image...")

    for x in range(imgsize[0]):
        for y in range(imgsize[1]):
            for i in range(3):
                if n + i >= len(data):
                    image[x][y][i] = 0
                else:
                    image[x][y][i] = data[n + i]
            n += 3
    img = Image.fromarray(image, "RGB")
    img.save("image.png", "png")
    print("Done!")
    img.close()
    exit(0)

elif len(data) > sizes[len(sizes)-1]:
    max_size = len(sizes) - 1
else:
    for i in range(len(sizes)):
        if len(data) < sizes[i]:
            max_size = i

print("select size: ")
for i in range(0, max_size):
    print(f"{i}: {sizes_size[i]['name']}")

s_size = input("size: ").strip()
while s_size not in [str(x) for x in range(0, max_size)]:
    print("Unknown option\n\n")
    print("select size: ")
    for i in range(0, max_size):
        print(f"{i}: {sizes_size[i]['name']}")

    s_size = input("size: ").strip()

s_size = int(s_size)

print(sizes[s_size], len(data))

if sizes[s_size] > len(data):
    print("data is smaller then a single frame, outputting image")
    image = np.zeros((sizes_size[s_size]["dimensions"][0], sizes_size[s_size]["dimensions"][1], 3))
    n = 0

    print("writing to image...")

    for y in range(sizes_size[s_size]["dimensions"][1]):
        for x in range(sizes_size[s_size]["dimensions"][0]):
            for i in range(3):
                if n + i >= len(data):
                    image[x][y][i] = 0
                else:
                    image[x][y][i] = data[n + i]
            n += 3
    img = Image.fromarray(image, "RGB")
    img.save("image.png", "png")
    print("Done!")
    img.close()
    exit(0)
else:
    extra = len(data) % sizes[s_size]
    frames = (len(data) - (len(data) % sizes[s_size])) // sizes[s_size]

    if extra > 0:
        frames += 1

    print(f"target:  {sizes[s_size]}\ncurrent: {len(data)}\nextra: {extra}\nframes: {frames}\n\n")

    start = time.time()
    print("making frames")
    frames_data = [np.ones((sizes_size[s_size]["dimensions"][1], sizes_size[s_size]["dimensions"][0], 3)) for x in range(frames)]
    print(f"Took {time.time() - start}\n")

    n = 0
    empty = False

    start = time.time()
    print("writing frames...")
    for i in range(frames):
        for x in range(sizes_size[s_size]["dimensions"][0]):
            for y in range(sizes_size[s_size]["dimensions"][1]):
                if empty:
                    frames_data[i][y][x] = (0, 0, 0)
                for d in range(3):
                    # if we don't have data available, from having not enough data to fill out a frame, we just fill it with black
                    if n+1+d >= len(data):
                        frames_data[i][y][x][d] = 0
                        empty = True
                    else:
                        frames_data[i][y][x][d] = data[n+d]
                    n += 1

    print(f"Took {time.time() - start}")

    video = cv2.VideoWriter("video.mp4", cv2.VideoWriter_fourcc(*"mp4v"), 1, (sizes_size[s_size]["dimensions"][0], sizes_size[s_size]["dimensions"][1]))

    for frame in frames_data:
        video.write(frame)

    video.release()
    print("Done!")

#pragma once
